    //     alt="..."
    //   />
    //   <div className="card-body text-center">
    //     <p className="card-title">Login to see Bid Status</p>
    //     <a href="#" className="btn btn-primary">
    //       VIEW THIS LOT
    //     </a>
    //   </div>
    // </div>
    // <MDBCard className="card ml-3 mt-5" style={{ width: "18rem" }}>
    //   <MDBCardImage
    //     src="https://online-auction.state.gov/Image/Get?id=8334df7d-dc13-4930-b532-98c0489145ba&size=2"
    //     position="top"
    //     alt="..."
    //     className="card-img-top"
    //   />
    //   <MDBCardBody className="card-body text-center">
    //     <MDBCardTitle>Login to see Bid Status</MDBCardTitle>
    //     <MDBBtn href="" className="btn btn-primary">
    //       VIEW THIS LOT
    //     </MDBBtn>
    //   </MDBCardBody>
    // </MDBCard>

    <div className="row">
      <div className="col-md-6">
        <Card className="card ml-3 mt-5" style={{ width: "18rem" }}>
          <CardMedia
            component="img"
            src="https://online-auction.state.gov/Image/Get?id=8334df7d-dc13-4930-b532-98c0489145ba&size=2"
            alt="..."
          />
          <CardContent className="card-body text-center">
            <Typography variant="h5">Login to see Bid Status</Typography>
            <Button href="" variant="contained" color="primary">
              VIEW THIS LOT
            </Button>
          </CardContent>
        </Card>
      </div>
      import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';
import Typography from '@material-ui/core/Typography';
import CheckCircleIcon from '@material-ui/icons/CheckCircle';

<Grid item xs={12} md={6}>
  <Box display="flex" alignItems="center">
    <Typography variant="h6" component="div" className="name-of-the-item">
      Printer - AG0233P AG0889D AG0960H AG1068J AG1097G
    </Typography>
    <Box ml={1}>
      <Box display="flex" alignItems="center" className="oa-generic-status-indicator" bgcolor="#73a839">
        <CheckCircleIcon fontSize="small" />
        <Typography variant="caption" component="div" color="inherit">
          Active
        </Typography>
      </Box>
    </Box>
  </Box>
</Grid>
    </div>
  );
}
